import React from 'react'
import './Header.css'
import Header from './Header'
import Home from './Home'
import Checkout from './Checkout'
import {Routes,Route} from 'react-router-dom'
function App() {
    return (
        <div className="App">
            <Routes>
                <Route path="/Checkout" element={
                    <>
                        <Header />
                        <Checkout />
                    </>
                        }/>
                <Route path="/" element={
                    <>
                        <Header />
                        <Home/>
                    </>
                } /> 

            </Routes>


        </div>
    )
}

export default App;
